// Import React
import React, {Component} from 'react';
import Home from './Home';
import Welcome from "./Welcome";

class App extends Component {

  constructor() {
    super();
    this.state = {
      user: 'Ray'
    };
  }

  render() {
    return (

        <div>
          <Home user={this.state.user}/>
          <Welcome user={this.state.user}/>
        </div>
    );
  }
}

export default App;
